{"title":"gitee_issues_efficiency_help","type":"markdown","params":{"fontSize":10,"markdown":"This panel focuses on **closed** Gitee issues.

**BMI**: Backlog Management Index, defined as the number of closed issues divided by the number of open ones in a given period of time. Measures efficiency closing issues.

**Lead time**: the time expressed in days between the initiation and completion of a production process, in this case, an issue. Shown in average."},"aggs":[]}

{"title":"gitee_pull_requests_efficiency_help","type":"markdown","params":{"fontSize":10,"markdown":"This panel focuses on **solved** (merged OR closed) gitee pull requests.

**REI**: Review Efficiency Index, defined as the number of solved pull requests divided by the number of open ones in a given period of time. Measures efficiency solving pull requests.

**Lead time**: the time expressed in days between the initiation and completion of a production process, in this case, a pull request. Shown in average."},"aggs":[]}

{"title":"git_demographics_help","type":"markdown","params":{"fontSize":12,"markdown":"This panel shows **the history of contributors active in last 10 years** focused on the first and last contribution of each person.

**WARNING**: Pre-computed data displayed. Dynamic filters like time picker won't work as expected.

For more information, please read [panel documentation page](https://chaoss.github.io/grimoirelab-sigils/panels/git-demographics/)."},"aggs":[]}

{"title":"affiliations_help","type":"markdown","params":{"fontSize":10,"markdown":"This panel shows information about identities and the organizations they are affiliated. The main purpose of this panel is to determine which identities do not have any affiliation. These identities are set to **Unknown**.

By default, the panel shows aggregated data of the different data sources available. Data can be filtered by data source using the tag cloud or the selector box.

**Authors** table is **limited** to **1000** entries due to memory and transmission performance."},"aggs":[]}
